    public void emptyFile() throws IOException {
        File tempfile = File.createTempFile("md5-test-", ".txt");
        String checksum = MD5.md5(tempfile);
        assertTrue(tempfile.delete());

        assertEquals("d41d8cd98f00b204e9800998ecf8427e", checksum);
    }

